function AHome() {
    const adminDetails=  localStorage.getItem('admininfo')
    console.log(adminDetails);
  return (
    <div>
       
    {  adminDetails ?  <AdminHome/> : <ALoginPage/> }
    </div>
  )
}

export default AHome
